app.get('/signup',(req,res)=>{
  res.render('signup.ejs');
});
app.post('/signup',async(req,res)=>{
  try{
    const checku =await userdata.findOne({username:req.body.username});
    if(checku){
      res.redirect('/signup');
    }else{
      const check=await userdata.findOne({email:req.body.email});
      console.log(check);
      if(check.username===req.body.username){  
          res.send("Username Already Present");
      }else{
        res.send('email already present')
      }
  }
  }
  catch{
    const udata= new userdata(req.body);
    await userdata.insertMany([udata]);
    res.redirect('/menu');
  }
})
app.post('/login',async(req,res)=>{
  
  try{
    const check=await userdata.findOne({username:req.body.username})
    if(check.password==req.body.password){
      if(check.email==req.body.email){
        res.redirect('/homepage');
      }
    }
  }
  catch{
    res.send("Wrong Details");
  }
})
